import React from 'react';

import './index.css';

import Nav_Top from "./Nav_Top";
import Main from './Main';
import Header from "./Header";
import AboutUS from './AboutUS'

const index = () => (
  <React.StrictMode>
      <Nav_Top />
      <Header />
      <AboutUS />
      <Main />

  </React.StrictMode>
);

export default index;



